import styled from "styled-components"
import CicleProgress from "./CicleProgress"
import ShareLine from "./ShareLine"


const Container = styled.div`
    font-family: WantedSans-Regular;
    margin-top : 40px;
    font-size : 16px;
    padding : 5px;

`

const Range = styled.div`
display : flex;
flex-flow: row wrap;
line-height : 1;

`

function Stack() {

    return (
        <Container>
            <ShareLine title="My Stacks" />
            <Range>
                <CicleProgress percent={100} title={"C#"} color={"#240F85"} />
                <CicleProgress percent={80} title={"Python"} color={"#0079FA"}/>
                <CicleProgress percent={50} title={"JavaScript"} color={"#F5CF01"}/>
                <CicleProgress percent={50} title={"Net Framework"} color={"#240F85"}/>
                <CicleProgress percent={50} title={"DJango"} color={"#042940"}/>
                <CicleProgress percent={50} title={"React"} color={"#05AFFA"}/>
                <CicleProgress percent={50} title={"Git"} color={"#3A00F5"}/>
                <CicleProgress percent={50} title={"AWS"} color={"#3A00F5"}/>

            </Range>

        </Container>
    )
}

export default Stack
